import React from "react";
import modelMan from "../media/sapiens(1).png";

function Hero() {
  return (
    <div className="flex border-2 border-red-500 mx-auto max-w-3xl md:mt-24">
      <ul className="grid grid-cols-1 gap-8 md:grid-cols-2 px-2 md:gap-8">
        {/* Practical */}
        <li className="md:text-center items-center rounded-lg md:h-full h-full px-3">
          <img src={modelMan} alt="Man" />
        </li>
        {/* Reliable */}
        <li className=" items-center h-full px-10">
          <p className="pt-9 text-left uppercase tracking-widest text-sm font-light">
            A whole new world
          </p>
          <h1 className="text-6xl text-left font-bold">webfast</h1>
          <p className="text-sm mt-4">
            The top-rated Hosting Solution for personal and small business
            websites in four consecutive years by the HostAdvice Community!
            Welcome to the <div className="text-indigio-500">webfast</div>{" "}
            Family!
          </p>
        </li>
      </ul>
    </div>
  );
}

export default Hero;
